  <meta name="description" content="WOD del día... En Möbius somos un equipo apasionado por el deporte, la salud y el bienestar, como la palabra lo dice “bien – estar” va más allá de sólo hacer ejercicio. En Möbius vas a encontrar profesionales que te llevarán a encontrar un estilo de vida donde la prioridad es tu salud. Desde una correcta alimentación, mantenimiento a nuestro cuerpo con profesionales en Fisioterapia, quiropráctica. Un correcto régimen de entrenamiento de menos a más según tus necesidades y habilidades. En Möbius encontrarás una atmósfera de equipo donde es igual de importante el último en terminar el WOD (Workout of the day) así como el primero. No te dejaremos renunciar, será la mejor manera de alcanzar tus metas de fitness, es más que sólo ir a hacer ejercicio, es una competencia contigo mismo donde la batalla puede ser poder ejecutar una lagartija, hasta una sentadilla de 300kg. Depende de ti y el equipo de Möbius estará cuidándote en cual quiera que sea tu meta." />
