<div class="w-mobius row-fluid text-center">
<h1>¿QUÉ ES MÖBIUS?</h1>
<p>En Möbius somos un equipo apasionado por el deporte, la salud y el bienestar, como la palabra lo dice “bien – estar” va más allá de sólo hacer ejercicio. En Möbius vas a encontrar profesionales que te llevarán a encontrar un estilo de vida donde la prioridad es tu salud. Desde una correcta alimentación, mantenimiento a nuestro cuerpo con profesionales en Fisioterapia, quiropráctica. Un correcto régimen de entrenamiento de menos a más según tus necesidades y habilidades. En Möbius encontrarás una atmósfera de equipo donde es igual de importante el último en terminar el WOD (Workout of the day) así como el primero. No te dejaremos renunciar, será la mejor manera de alcanzar tus metas de fitness, es más que sólo ir a hacer ejercicio, es una competencia contigo mismo donde la batalla puede ser poder ejecutar una lagartija, hasta una sentadilla de 300kg. Depende de ti y el equipo de Möbius estará cuidándote en cual quiera que sea tu meta.</p>
</div>
<div class="w-crossfit row-fluid text-center">
<h2>¿QUÉ ES CROSSFIT?</h2>
<p>"Movimientos funcionales, constantemente variados, realizados a alta intensidad para obtener un estado físico de fitness completo y, por tanto, estar preparado para cualquier reto físico." - Cortesía de CrossFit Inc.</p>
</div>
<div class="m-crossfit row-fluid text-center">
<h2>MITOS DEL CROSSFIT</h2>
<p>CrossFit es sólo para hombres. <span class="falso">Falso.</span></p>
<p>Para entrar a CrossFit debo tener un alto rendimiento. <span class="falso">Falso.</span></p>
<p>CrossFit sólo tiene un nivel: DIFÍCIL. <span class="falso">Falso.</span></p>
<p>En CrossFit te obligaremos a revolcarte en <br /> el lodo mientras te gritamos para animarte. <span class="falso">Falso.</span></p>
<p>CrossFit estimula el crecimiento exagerado de masa muscular. <span class="falso">Falso.</span></p>
</div>
	
</div>

